/* Reset for consistency */
* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: 'Arial', sans-serif; font-size: 16px; }

/* Test-specific CSS */
.container {
    width: 700px;
    height: 300px;
    display: flex;
    gap: 20px;
    border: 2px solid #333;
    padding: 15px;
}
.item {
    flex: 1;
    padding: 15px;
    box-sizing: border-box;
    background-color: #f8f9fa;
    border: 1px solid #dee2e6;
}
h4 {
    margin-bottom: 10px;
    font-size: 14px;
    color: #495057;
}
ul, ol {
    margin: 8px 0;
    padding-left: 20px;
}
li {
    margin: 3px 0;
    font-size: 12px;
    line-height: 1.4;
}
.nested-list {
    margin-top: 5px;
}
.description-list dt {
    font-weight: bold;
    margin-top: 8px;
    font-size: 11px;
}
.description-list dd {
    margin-left: 15px;
    margin-bottom: 5px;
    font-size: 11px;
}
